import React from 'react';
import Table from '../components/Table/Table.js'

const FaceRecognition = ({imageURL,age, masculine, feminine, multiculturalAppearance}) => {
    return(
        <div className='center ma'>
            <div className='absolute mt2'>
                <img src={imageURL} width='300px' height='auto'/>
                <div>
                    <Table 
                    age={this.age}
                    masculine={this.masculine}  
                    feminine={this.feminine} 
                    multiculturalAppearance={this.multiculturalAppearance}
                    />
                </div>
            </div>
        </div>
    )
}

export default FaceRecognition;
